import { css } from "styled-components";

export const ValignTextMiddle = css`
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

export const ValignTextBottom = css`
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
`;

export const PoppinsNormalShuttleGray17px = css`
  color: var(--shuttle-gray);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalCharade17px = css`
  color: var(--charade);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalShuttleGray12px = css`
  color: var(--shuttle-gray);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xxs);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalCadetBlue17px = css`
  color: var(--cadet-blue);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalShuttleGray14px = css`
  color: var(--shuttle-gray);
  font-family: var(--font-family-poppins);
